import React, { useState } from "react";
import "./SideBar.css";
import HouseIcon from '@mui/icons-material/House';
import SearchIcon from '@mui/icons-material/Search';
import StarOutlineIcon from '@mui/icons-material/StarOutline';
import QueueMusicIcon from '@mui/icons-material/QueueMusic';
import AddCircleOutlinedIcon from '@mui/icons-material/AddCircleOutlined';

export default function SideBar(){

    const [home,setHome]= useState(true);
    const [search,setSearch]= useState(false);
    const [fav,setfav]= useState(false);
    const [play,setPlay]= useState(false);

    return(
        <>
           <div className="s">
               <div className="s-items">
                   <div className={home ? "s-home active" : "s-home"}>
                      <HouseIcon sx={{color:"white"}} fontSize="large"/> 
                      <a classname="s-diff" onClick={()=>{
                         setHome(true);setSearch(false);setPlay(false);setfav(false);
                      }}>Home</a>
                   </div>
                   <div className={search ? "s-search active":"s-search"}>
                       <SearchIcon fontSize="large"/> 
                       <a classname="s-diff" onClick={()=>{
                            setHome(false);setSearch(true);setPlay(false);setfav(false);
                       }}>Search</a>
                    </div>
                   <div className={fav ? "s-fav active":"s-fav"}>
                         <StarOutlineIcon fontSize="large"/> 
                         <a classname="s-diff" onClick={()=>{
                                setHome(false);setSearch(false);setPlay(false);setfav(true);
                         }}>Favourites</a> 
                   </div>
                   <div className={play ?"s-palylist active ":"s-playlist"}>
                         <QueueMusicIcon fontSize="large"/> 
                         <a classname="s-diff" onClick={()=>{
                                setHome(false);setSearch(false);setPlay(true);setfav(false);
                         }}>PlayList</a>
                   </div>
                   <div className="s-addplist">
                        <AddCircleOutlinedIcon fontSize="large"/> <a classname="s-diff">Create Playlist</a>
                   </div>
               </div>
           </div>
        </>
    );
}
